function App() {
  return (
    <div className="hero">
      <div className="logo">
        <img src="././public/mahakala_logo_new.png" alt="mahakala_logo" />
      </div>
      <p>
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Contact</a>
      </p>
    </div>
  );
}

export default App;
